import React from "react";

const ShowClasses = (props) => {
  const { name, description, time, imageUrl } = props.course;

  const cardStyle = {
    img: {
      width: "100%",
      height: "200px",
      align: "center",
    },

    buttonStyle: {
      border: "none",
      borderRadius: "20px",
      backgroundColor: "#81D8D0",
    },
  };

  return (
    <div className="">
      <div
        style={{
          margin: "10px",
          borderRadius: "20px",
          padding: "10px",
          boxShadow: "0px 10px 40px rgb(0 0 0 / 10%",
        }}
      >
        <img
          style={cardStyle.img}
          class="card-img-top"
          src={imageUrl}
          alt="Card image cap"
        />
        <div class="card-body">
          <h5 class="card-title">{name}</h5>
          <p class="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
          <button
            style={cardStyle.buttonStyle}
            type="button"
            class="btn  btn-lg btn-block"
          >
            Order
          </button>
        </div>
      </div>
    </div>
  );
};

export default ShowClasses;
